import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css'; 
import Post from "./components/post";
import Header from "./components/Header";
import { BrowserRouter} from "react-router-dom";

function App() {
    return (
      <>
        <BrowserRouter>
          <Header/>
          <Post/>
        </BrowserRouter>
      </>
    );
  }
 export default App;
